  function FormatDate(dat, format){
    function TwoNumbers(val) {
      if (val < 10) {
        return '0' + val;
      } else {
        return val;
      }
    }
    var res = '';
    var oper = '';
    var last = false;
    for (var i = 0; i < format.length; i++){
      oper = format.substring(i,i+1);
      if (oper == last) continue;
      switch (oper){
        case 'Y': res += dat.getFullYear(); break;
        case 'y': res += dat.getYear(); break;
        case 'm': res += TwoNumbers(dat.getMonth()+1); break;
        case 'j': res += TwoNumbers(dat.getMonth()+1); break;
        case 'd': res += TwoNumbers(dat.getDate()); break;
        case 'n': res += dat.getDay(); break;
        case 'w': res += dat.getDay(); break;
        default: res += oper;
      }
      last = oper;
    }
    return res;
  }

