var GOL = GOL || {}; // namespace
GOL.ForAll = GOL.ForAll || {};

GOL.ForAll.Captcha = function(jQuery, url, isExternalUrl, grecaptcha) {
  var $ = jQuery;

  function getCaptchaParams(onSuccess, onError) {
    var params = createAjaxParams(onSuccess, onError);
    return $.ajax(params);
  };

  function createAjaxParams(onSuccess, onError) {
    var params = {
      url: url,
      dataType: 'json',
      type: 'POST',
      data: {
        action: 'eSearchFormData',
        iframe: 'captchaToken',
        data: {
          ajax: 'captchaToken',
          isExternalUrl: isExternalUrl
        }
      },
      success: onSuccess,
      error: onError
    };
    if (isExternalUrl) {
      params.jsonpCallback = 'jsonCallback';
      params.dataType = 'jsonp';
    }
    return params;
  }

  this.render = function() {
    getCaptchaParams(function(data) {
      if (data.required) {
        grecaptcha.render('j-captcha', {
          "sitekey": data.sitekey,
          "stoken": data.stoken
        });
      }
    }, function(jqXHR, textStatus, errorThrown) {

    });
  };

};

